sys_variable_value.value:
(function execute(inputs, outputs) {
    var payload = {};
    var updateMask = [];
    outputs.name = "projects/" + inputs.projectid + "/topics/" + inputs.name;
    var pubSub = new GooglePubsubUtils();
    pubSub.validateInputVariables(inputs, outputs);
    pubSub.validateMandatoryVariables(inputs, ["name"]);
    var labels = pubSub.arrayObjecttoObject(inputs.labels);
    if (typeof labels == "object") {
        payload["labels"] = labels;
        updateMask.push("labels");
    }
    if (pubSub.newArrayObject(inputs.storedregions).length > 0) {
        payload["messageStoragePolicy"] = {
            "allowedPersistenceRegions": pubSub.newArrayObject(inputs.storedregions)
        }
        updateMask.push("messageStoragePolicy");
    }
    if (updateMask.length < 0)
        throw new Error("Update Message Stored Regions or Labels");
    var requestBody = {
        "topic": payload,
        "updateMask": "labels"
    }
    outputs.payload = JSON.stringify(requestBody);
})(inputs, outputs);

